long long compute_hash(string& s){
	const int p = 31;
	const int MOD = 1e9 + 7;
	long long hash_value = 0;
	long long ppow = 1;

	for(char& c: s){
		hash_value = (hash_value%MOD + (c-'a'+1)*ppow%MOD)%MOD;
		ppow = (ppow*p)%MOD;
	}
	return hash_value;
}

